import SocialItem from "./SocialItem";

function Social() {
    return (
        <ul className="list-group">
            <SocialItem />
            <SocialItem />
            <SocialItem />
        
            <li className="list-group-item">
                <input class="form-check-input me-1" type="checkbox" id="youtube" />
                <label for="youtube"> Youtube</label>
                </li>
            <li className="list-group-item">
            <input class="form-check-input me-1" type="checkbox" id="instgram" />
            <label for="instgram"> Instagram</label></li>
     </ul>
    )
}

export default Social;
